        <meta charSet="utf-8" />
        <meta httpEquiv="X-UA-Compatible" content="IE=edge" />
        <title>Pustok - Book Store HTML Template</title>
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        {/* Use Minified Plugins Version For Fast Page Load */}
        <link rel="stylesheet" type="text/css" media="screen" href="css/plugins.css" />
        <link rel="stylesheet" type="text/css" media="screen" href="css/main.css" />
        <link rel="shortcut icon" type="image/x-icon" href="image/favicon.ico" />
        {/* ----------------------------------------head------------------------------------------------------------------------ */}
        <h1>OMAIMA HEADER</h1>
        {/* ----------------------------------------foouter------------------------------------------------------------------------ */}
        {/* ***********************************************************************/}
        <div className="site-wrapper" id="top">
          <section className="section-margin">
            <h1 className="sr-only">Promotion Section</h1>
            <div className="container">
              <div className="row">
                <div className="col-lg-6">
                  <a href="#" className="promo-image promo-overlay">
                    <img src="image/bg-images/promo-banner-with-text.jpg" alt="" />
                  </a>
                </div>
                <div className="col-lg-6">
                  <a href="#" className="promo-image promo-overlay">
                    <img src="image/bg-images/promo-banner-with-text-2.jpg" alt="" />
                  </a>
                </div>
              </div>
            </div>
          </section>
        </div>		
        {/* ***********************************************************************/}
        {/* Use Minified Plugins Version For Fast Page Load */}
        {/* Mirrored from demo.hasthemes.com/pustok-preview/pustok/shop-grid.html by HTTrack Website Copier/3.x [XR&CO'2014], Sun, 08 Mar 2020 14:27:41 GMT */}
      </div>
    );
  }
}


export default Ads;
